import React from 'react'
import ShopCart from './ShopCart'



export default function Products() {
  return (
    <section className='product'>
        <div className='producthead'>
            <h2>ПРОДУКЦИЯ</h2>
        </div>
        <div className='shop'> 
        <main className='shopCart'>
        {this.props.items.map(el => (
          <h1>{el.title}</h1>
        ))}
      </main>
        </div>
        
    </section>
  )
}
